import React, { useRef } from 'react'
import { useState } from 'react'

export default function ImagesList({ albumid }) {
      
      const [searchbar , setsearchbar] = useState(true)
      const searchref = useRef();
      const [imagelist  , setimagelist ] = useState([
            {
                  name : 'nature',
                  url : "data:image/jpeg;base64,"
            },
            {
                  name : 'scotty',
                  url : "data:image/jpeg;base64,",
            },
            {
                  name : 'men',
                  url : "data:image/jpeg;base64,"
            },
            {
                  name : 'lazy',
                  url : "data:image/jpeg;base64,",
            },{

            }
      ])
      
      
      return (
            <div className='imagelistmain' >

                  <div className='imagelistheading'> 

                        <img src='https://cdn-icons-png.flaticon.com/128/4155/4155120.png' className='backbutton'  alt='one step back button ' />
                        <h2>Images in {albumid}</h2>
                        {
                              searchbar? <input placeholder=' search... '  className='searchbar' ref={searchref} /> : null
                        }
                        <img src='https://cdn-icons-png.flaticon.com/128/1296/1296902.png' className='searchbutton' alt='searchbutton'   />
                        <button className='addimagebutton' > Add Image </button>
                  </div>

                  <ul className='albumlist' >
                              {
                                    imagelist.map((alb) => {
                                          return (
                                                <>
                                                      <li className='imageitem' o >
                                                            <div className='imagedisplay' style={{backgroundImage : `url('${alb.url}')`}} >
                                                            </div>
                                                            <h3 className='imagetitle' > {alb.name} </h3>
                                                      </li>
                                                </>
                                          )
                                    })
                              }


                        </ul>
            </div>
      )
}
